@Cereal_Dust I think you need to actually read the comment I made. lol your reply is exactly what I don't care about!!!!
 You judge without knowledge and you havent yet seeked any understanding without condemning
 Maybe take an English class and update your reading comprehension.

@@RainyDaySprite  "You missed the point! It’s not about not caring. It’s about caring." 
 @Mountprospect1  never said anything about 'not caring.' It was SIMPLY  a comment to let people know that AS WE AGE, insecurity falls away somewhat (a lot). And THAT is something to look forward to. And why would you claim that this person 'missed the point'? There wasn't any suggestion of leaving things 'til one is older. There was just the information that, as we age, we become less focused and less insecure about what people think about us. 

(And that is mostly because we realize that people are usually NOT thinking about us at all, but are focused on their own stuff).
